import React, { Component } from 'react'
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';

import Container from '@material-ui/core/Container';
import { withStyles } from '@material-ui/core/styles';
import styleing from "./css/solution.module.css";
const styles = theme => ({
    cardGrid: {
        paddingTop: theme.spacing(8),
        paddingBottom: theme.spacing(8)
      },
    card: {
      height: '100%',
      display: 'flex',
      flexDirection: 'column',
    },
    cardMedia: {
      paddingTop: '75.25%',
      backgroundPosition:'center'
    },
    cardContent: {
      flexGrow: 1,
    }
  });


class Solutions extends Component {

    render() {
        const {classes} = this.props;



        const Solution = (
            <Grid item key={this.props.key}  xs={12} sm={3} md={4}>
                   
                  <Card className={classes.card}>
                    <CardMedia
                      className={classes.cardMedia}
                      image={this.props.thumbnail}
                      title={this.props.heading}
                      style={{backgroundColor:'black'}}
                    />
                    <CardContent className={classes.cardContent} >
                      <Typography gutterBottom variant="h5" component="h2">
                      {this.props.heading}
                      </Typography>
                      <Typography>
                       {this.props.content}
                      </Typography>
                    </CardContent>
                    
                  </Card>
                </Grid>
        )

        return (
              
            <Container  className={classes.cardGrid} maxWidth="md">
            <Grid style={styleing.grid} container spacing={5}>
       
                {Solution}
           
            </Grid>
        </Container>
                                    
        )
    }
}

export default withStyles(styles, { withTheme: true })(Solutions);
